import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { LoginComponent } from './login/login.component';
import { SignupComponent } from './signup/signup.component';
import { RestaurantDashComponent } from './restaurant-dash/restaurant-dash.component';

const routes: Routes = [
  {
    path:'',redirectTo:'login',pathMatch
  },
  {
    path:'login', component:LoginComponent //route to login
  },
  {
    path:'signup',component:SignupComponent //route to signup
  },
  {
    path:'restaurant',component:RestaurantDashComponent //route to dashboard
  }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
